    false,nt"url": null,nt"notes": "Water conditions for Stillwater Marshes
    were good for 1975. Marsh habitat acreage totaled 18,670 acres in August, compared
    to only 9,300 acres in August, 1974. Due to limited manpower, only Swan Lake and
    West Marsh Units were surveyed for aquatic plant production. Good stands of alkali
    and hardstem bulrush were found along most shorelines. Waterfowl use for the July-December
    period was up 35% over the same period in 1974. No visits were made to Anaho Island
    in during this period. All available information for 1975 is in the FY 1975 Narrative.
    The Fallon National Wildlife Refuge lies north of Stillwater on what is primarily
    a barren alkali flat know as the Carson Sink. In recent years there has not been
    enough available water for Fallon to produce much in the was of wildlife or recreational
